impl Solution {
    pub fn leftmost_building_queries(heights: Vec<i32>, queries: Vec<Vec<i32>>) -> Vec<i32> {
        let n = heights.len();
        let mut next_meet = vec![-1; n];
        let mut stack: Vec<usize> = vec![];

        // Preprocess to find the next building to the right that is taller
        for i in (0..n).rev() {
            while !stack.is_empty() && heights[i] >= heights[*stack.last().unwrap()] {
                stack.pop();
            }
            if !stack.is_empty() {
                next_meet[i] = stack.last().copied().unwrap() as i32;
            }
            stack.push(i);
        }

        queries.iter().map(|query| {
            let (mut a, b) = (query[0] as usize, query[1] as usize);
            if a > b {
                return -1;
            }
            while a < b && next_meet[a] != -1 && next_meet[a] as usize <= b {
                a = next_meet[a] as usize;
            }
            if a == b { a as i32 } else { -1 }
        }).collect()
    }
}
